	private static ArrayList<ArrayList<Point2D.Double>> getPoints(Area a) {
		PathIterator i = a.getPathIterator(null, 0);
		ArrayList<ArrayList<Point2D.Double>> ret = new ArrayList<>();
		ArrayList<Point2D.Double> cr = new ArrayList<>();
		while (!i.isDone()) {
			double[] coords = new double[6];
			int t = i.currentSegment(coords);
			if (t == PathIterator.SEG_MOVETO) {
				cr.add(new Point2D.Double(r(coords[0]), r(coords[1])));
			} else if (t == PathIterator.SEG_LINETO) {
				Point2D.Double np = new Point2D.Double(r(coords[0]), r(coords[1]));
				if (np.distance(cr.get(cr.size() - 1)) > 0.000001) {
					cr.add(np);
				}
			} else if (t == PathIterator.SEG_CLOSE) {
				ret.add(cr);
				cr = new ArrayList<>();
			} else {
				throw new RuntimeException("Unsupported Op: " + t);
			}
			i.next();
		}
		return ret;
	}

	private static Path2D.Double pathFromString(String str) {
		String prevCommand = "";
		StringTokenizer t = new StringTokenizer(str, "MLZ", true);
		Path2D.Double path = new Path2D.Double();
		path.setWindingRule(Path2D.WIND_EVEN_ODD);
		while (t.hasMoreTokens()) {
			String command = t.nextToken();
			if (" ".equals(command)) {
			  continue;
			} else if ("Z".equals(command)) {
				path.closePath();
			} else {
				double[] point = parsePoint(t.nextToken(), false);
				if ("L".equals(command)) {
					path.lineTo(point[0], point[1]);
				} else if ("M".equals(command)) {
					path.moveTo(point[0], point[1]);
				} else {
					throw new RuntimeException("unrecognized command " + command);
				}
			}
		}
		return path;
	}

	private static double r(double a) {
		return Math.floor(a * 100) / 100;
	}

	private static double[] prev = new double[]{0, 0};
	private static double[] parsePoint(String p, boolean relative) {
		prev = new double[] { Double.parseDouble(p.substring(0, p.indexOf(","))) + (relative ? prev[0] : 0), Double.parseDouble(p.substring(p.indexOf(",") + 1, p.length())) + (relative ? prev[1] : 0) };
		return prev;
	}

